- input: "TEXT\x1CC00421271\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is in receipt
    of the Commission's Request for Additional Information dated 9/16/2008 regarding
    the Pre-Primary Report for 2008.  The Committee discovered that a record type
    had changed in the database which moved a $125 contribution from 11B to 11C.  The
    record type has been changed back to the correct line which in turn has corrected
    the Column B figures for the Summary and Detailed Summary Pages to reflect the
    current election cycle to date figures.  -  Additionally the Committee reviewed
    the duplicates records questioned by the Commission.  It was discovered that donors
    that previously had given with a written instrument and provided a home address
    then gave with credit cards online using a different address, either their mailing
    address or work address.  The Committee previously would do duplicate record searches
    within the same city to determine duplicates making the assumption that most donors
